import React from 'react'

const AddMovieForm = () => {
    return(
        <div style={right_div}>
        <form>
            <input type="text" style={title_line} placeholder="Movie Title"/>
            <input type="text" placeholder="Director"/>
            <select>
                <option value="--Rating--" disabled>-Rating-</option>
                <option value="G">G</option>
                <option value="PG">PG</option>
                <option value="PG-13">PG-13</option>
                <option value="R">R</option>
            </select>
            <input type="number" placeholder="Release Year"></input>
            <input type="number" placeholder="Runtime [mins]"></input>
        </form>
        </div>
    );
}

const right_div = {
    width: "60%",
    height: "100%",
    float: "right"
}

const title_line = {
    width: "80%"
}

export default AddMovieForm
